import React from "react";

export default function Rating(props) {
  const { ratings, numReviews } = props;
  return (
    <div className="rating">
      <span>
        <i className="fa fa-star"></i>
      </span>
      <span>
        <i className="fa fa-star"></i>
      </span>
      <span>
        <i className="fa fa-star"></i>
      </span>
      <span>
        <i className="fa fa-star-half-o"></i>
      </span>
      <span>
        <i className="fa fa-star-o"></i>
      </span>
    </div>
  );
}
